(72, 1, '2021-01-31 10:45:44', '2021-01-31 15:45:44', '<h3>Eos an sumo integre recteque</h3>		\n			<h2>About Us</h2>		\n		<p>Eu iusto dolorum pro, facer oportere duo ne. Cum ei commune instructior. Ne dicat qualisque ullamcorper ius, ubique dolorum consetetur in vis. Nisl commodo te sed.</p><p>Diam donec adipiscing tristique risus nec. Vitae congue mauris rhoncus aenean vel. Feugiat nisl pretium fusce id velit ut tortor. Non diam phasellus vestibulum lorem. Etiam erat velit scelerisque in dictum. At auctor urna nunc id cursus. Odio ut sem nulla pharetra diam sit amet. Bibendum enim facilisis gravida neque convallis a cras semper. Eu feugiat pretium nibh ipsum consequat.</p>		\n					<ul>\n							<li>\n										123 Somewhere St. City, ST\n									</li>\n								<li>\n										hello@oursite.co\n									</li>\n								<li>\n										+1 234 567 8900\n									</li>\n						</ul>', 'About - Image, Heading &amp; Copy', '', 'publish', 'closed', 'closed', '', 'about-image-heading-copy', '', '', '2021-01-31 10:45:44', '2021-01-31 15:45:44', '', 0, 'http://localhost/monica/?elementor_library=about-image-heading-copy', 0, 'elementor_library', '', 0),
